import React, { useState, useEffect, useCallback, useContext } from "react";
import { 
  Box, 
  Button, 
  TextField, 
  Typography, 
  Paper, 
  Divider, 
  Container, 
  InputAdornment, 
  IconButton 
} from "@mui/material";
import { useNavigate } from "react-router-dom";
import axiosInstance from "../utils/axios";
import EmailIcon from '@mui/icons-material/Email';
import LockIcon from '@mui/icons-material/Lock';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import backgroundImage from "../assets/entrepreneurship-for-teens-1080x675.jpeg"; // Correct import

function Login() {
  const navigate = useNavigate();
  const { setAuth } = useContext(AuthContext);
  const [formData, setFormData] = useState({
    email: "",
    password: "",
  });
  const [error, setError] = useState("");
  const [showPassword, setShowPassword] = useState(false);
  const [loading, setLoading] = useState(false);

  const handleGoogleCallback = useCallback(async (response) => {
    setLoading(true);
    try {
      if (!response.credential) throw new Error("No credential received from Google");
      const result = await axiosInstance.post("/api/auth/google", { idToken: response.credential });
      localStorage.setItem("user", JSON.stringify(result.data));
      setAuth({ isAuthenticated: true, user: result.data });
      navigate("/");
    } catch (err) {
      setError(err.message || "Google authentication failed");
    } finally {
      setLoading(false);
    }
  }, [navigate, setAuth]);

  useEffect(() => {
    const script = document.createElement("script");
    script.src = "https://accounts.google.com/gsi/client";
    script.id = "google-signin-script";
    script.async = true;
    script.defer = true;
    document.body.appendChild(script);

    script.onload = () => {
      setTimeout(() => {
        if (window.google) {
          window.google?.accounts.id.initialize({
            client_id: "your-client-id",
            callback: handleGoogleCallback,
            ux_mode: 'popup',
          });
          window.google.accounts.id.renderButton(
            document.getElementById("googleSignInButton"),
            { theme: "outline", size: "large" }
          );
        } else {
          setError("Google Sign-In API failed to load.");
        }
      }, 300);
    };

    script.onerror = () => setError("Failed to load Google Sign-In script");

    return () => {
      const scriptToRemove = document.getElementById("google-signin-script");
      if (scriptToRemove) scriptToRemove.remove();
    };
  }, [handleGoogleCallback]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleClickShowPassword = () => setShowPassword(!showPassword);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    try {
      const response = await axiosInstance.post("/api/auth/login", formData);
      localStorage.setItem("user", JSON.stringify(response.data));
      setAuth({ isAuthenticated: true, user: response.data });
      navigate("/");
    } catch (err) {
      setError(err.response?.data?.message || "An error occurred");
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box
      sx={{
        display: 'flex',
        height: '100vh',
        background: `url(${backgroundImage}) no-repeat center center fixed`, // Correct background image
        backgroundSize: 'cover',
        justifyContent: 'center',
        alignItems: 'center',
        padding: '20px',
      }}
    >
      <Container maxWidth="sm">
        <Paper elevation={5} sx={{ p: 4, borderRadius: '15px', width: '100%', maxWidth: '450px' }}>
          <Typography variant="h4" component="h1" fontWeight="bold" sx={{ mb: 1 }}>
            SkillBridge
          </Typography>
          <Typography variant="subtitle1" color="textSecondary">Sign in to continue to your account</Typography>

          {error && (
            <Typography color="error" sx={{ mb: 2, textAlign: 'center' }}>
              {error}
            </Typography>
          )}

          <form onSubmit={handleSubmit}>
            <TextField
              fullWidth
              label="Email"
              name="email"
              type="email"
              value={formData.email}
              onChange={handleChange}
              margin="normal"
              required
              variant="outlined"
              InputProps={{
                startAdornment: <InputAdornment position="start"><EmailIcon color="primary" /></InputAdornment>,
              }}
            />
            <TextField
              fullWidth
              label="Password"
              name="password"
              type={showPassword ? "text" : "password"}
              value={formData.password}
              onChange={handleChange}
              margin="normal"
              required
              variant="outlined"
              InputProps={{
                startAdornment: <InputAdornment position="start"><LockIcon color="primary" /></InputAdornment>,
                endAdornment: (
                  <InputAdornment position="end">
                    <IconButton onClick={handleClickShowPassword} edge="end">
                      {showPassword ? <VisibilityOff /> : <Visibility />}
                    </IconButton>
                  </InputAdornment>
                ),
              }}
            />
            <Button type="submit" fullWidth variant="contained" disabled={loading}>
              {loading ? "Logging in..." : "Login"}
            </Button>
          </form>
        </Paper>
      </Container>
    </Box>
  );
}

export default Login;
